        /// <summary>
        /// [私有方法]
        /// 最大化/还原窗体
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void MxBtn_Click(object sender, EventArgs e)
        {
            if (Global._IsFormMax == false)
            {
                //最大化窗体
                Global._IsFormMax = true;
                mxBtn.BackgroundImage = Properties.Resources.Restore;
                glb.Maximized(this);
            }
            else
            {
                //向下还原窗体
                Global._IsFormMax = false;
                mxBtn.BackgroundImage = Properties.Resources.Maximize;
                glb.ThisSizeResize(this);
            }
        }

