        /// <summary>
        /// [私有方法]
        /// 开始
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void ToolStripMenuItem5_Click(object sender, EventArgs e)
        {
            int l = glb.SimpLanRecord();
            int d = tabControl.SelectedIndex;

            if (Global._IsOnStatus[d] == true)
            {
                try
                {
                    if (trs[d] == null)
                    {
                        trs[d] = new Timer();
                    }

                    if (sockets[d] == null)
                    {
                        sockets[d] = new Socket(AddressFamily.InterNetwork, SocketType.Stream, ProtocolType.Tcp);
                        sockets[d].Connect(Global._IpAddrs[d], Global._UsablePorts[d]);

                        Thread th;
                        switch (d)
                        {
                            case 0:
                                th = new Thread(Th_CycleDataAcq1);
                                th.IsBackground = true;
                                th.Start();
                                break;
                            case 1:
                                th = new Thread(Th_CycleDataAcq2);
                                th.IsBackground = true;
                                th.Start();
                                break;
                            case 2:
                                th = new Thread(Th_CycleDataAcq3);
                                th.IsBackground = true;
                                th.Start();
                                break;
                            case 3:
                                th = new Thread(Th_CycleDataAcq4);
                                th.IsBackground = true;
                                th.Start();
                                break;
                        }
                    }

                    trs[d].Interval = 1000;
                    Global._OnStatuMarks[d] = " ●";
                    Global._TstDates[d] = DateTime.Now.ToString("yyyy-MM-dd");
                    ToolStripLabel[] toolStripLabels = { toolStripLabel3, toolStripLabel6, toolStripLabel9, toolStripLabel12 };
                    toolStripLabels[d].Text = mul.TstDate[l] + " : " + Global._TstDates[d];

                    tabPage1.Text = mul.Dev[l] + "-1" + Global._OnStatuMarks[0];
                    tabPage2.Text = mul.Dev[l] + "-2" + Global._OnStatuMarks[1];
                    tabPage3.Text = mul.Dev[l] + "-3" + Global._OnStatuMarks[2];
                    tabPage4.Text = mul.Dev[l] + "-4" + Global._OnStatuMarks[3];
                    toolStripStatusLabel2.Text = tabControl.SelectedTab.Text;

                    trs[d].Start();
                }
                catch (Exception ex)
                {
                    if (trs[d] != null)
                    {
                        if (trs[d].Enabled)
                        {
                            trs[d].Stop();
                        }
                        trs[d] = null;
                    }

                    if (sockets[d] != null)
                    {
                        glb.SafeCloseSocket(sockets[d]);
                    }

                    Global._OnStatuMarks[d] = "";
                    tabPage1.Text = mul.Dev[l] + "-1" + Global._OnStatuMarks[0];
                    tabPage2.Text = mul.Dev[l] + "-2" + Global._OnStatuMarks[1];
                    tabPage3.Text = mul.Dev[l] + "-3" + Global._OnStatuMarks[2];
                    tabPage4.Text = mul.Dev[l] + "-4" + Global._OnStatuMarks[3];
                    toolStripStatusLabel2.Text = tabControl.SelectedTab.Text;

                    MessageBox.Show(ex.ToString(), mul.Exception[l], MessageBoxButtons.OK, MessageBoxIcon.Error);
                    return;
                }
            }
        }

